import React, { useState } from "react";
function Example() {
  const [count, setCount] = useState(0);
  return (
    <div>
      <p>{count}</p>
      <button
        onClick={() => {
          setCount((count = count + 100));
        }}
      >
        点击
      </button>
    </div>
  );
}
export default Example;
